import React, { useEffect, useState } from "react";
import UserData from "./UserData";

const Table = ({userData}) => {
  const [data, setData] = useState([]);

  

  useEffect(() => {
    fetch("http://localhost:8005/getAllUser",{
    method:'GET'
    })
        .then((res)=>res.json())
        .then((data)=>{
            console.log(data,"userData")
            setData(data.dta)
        })
  }, []);

  return (
    <>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Gender</th>
            <th>Income</th>
            <th>City</th>
            <th>Car</th>
            <th>Quote</th>
            <th>Phone price</th>
          </tr>
        </thead>
        <tbody>
          <UserData users={data} />
        </tbody>
      </table>
    </>
  );
};

export default Table;
